import React from "react";
import dayjs from "dayjs";
import "./ExpenseDate.css";



export default function ExpenseDate(props) {
  const date = dayjs(props.date);
  return (
    <div className="expense-date">
      <div className="expense-date__month">{date.format("MMM")}</div>
      <div className="expense-date__day">{date.format("DD")}</div>
      <div className="expense-date__year">{date.format("YYYY")}</div>
    </div>
  );
}
